import React from "react";
import './product.style.css'
import './product-container.style.css'



export const ProductsList = ({products,isChecked})=>{

    return  <div className="product-list col-xs-12" >
                {products.map((product)=>{
                   return  <label htmlFor={product.SKU} key={product.SKU}>
                        <div className="product-container">
                        <input type="checkbox" onChange={(e)=>isChecked(product.SKU,e)} className="delete-checkbox" id={product.SKU} />
                            <h2>{product.SKU}</h2>
                            <h1>{product.name}</h1>
                            <p>{product.price} $</p>
                            <p>{product.dropList}</p>
                            {product.dropList === "book" && <p>{`${product.weight} (KG)`}</p>}
                            {product.dropList === "dvd" && <p>{`${product.size} (MB)`}</p>}
                            {product.dropList === "furniture" &&
                                <ul className="list-inline">
                                    <li>{`${product.height}`} {`${product.len} `} {`${product.width} (CM)`}</li>
                                </ul>
                                }
                        </div>
                    </label>
                 })}
             </div>       
}
